PRAGMA foreign_keys=OFF;
BEGIN TRANSACTION;
CREATE TABLE "logs" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "msg" varchar NOT NULL, "level" varchar NOT NULL, "app" varchar, "tag" varchar, "pid" integer, "tid" integer(8), "ts" varchar, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "props" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "key" varchar NOT NULL, "value" varchar NOT NULL, "kind" varchar, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "tags" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "key" varchar NOT NULL, "slug" varchar NOT NULL, "name" varchar, "grade" integer DEFAULT 1 NOT NULL, "parent_id" integer, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "taggings" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "tag_id" integer NOT NULL, "taggable_id" integer NOT NULL, "taggable_type" varchar NOT NULL, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "places" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar NOT NULL, "kind" varchar NOT NULL, "lat" float, "lng" float, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "names" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar NOT NULL, "place_id" integer NOT NULL, "place_kind" varchar NOT NULL, "lang" varchar DEFAULT 'en' NOT NULL, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "continents" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar NOT NULL, "slug" varchar NOT NULL, "key" varchar NOT NULL, "place_id" integer NOT NULL, "alt_names" varchar, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "country_codes" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar NOT NULL, "kind" varchar NOT NULL, "country_id" integer NOT NULL);
CREATE TABLE "countries" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar NOT NULL, "slug" varchar NOT NULL, "key" varchar NOT NULL, "place_id" integer NOT NULL, "code" varchar NOT NULL, "alt_names" varchar, "hist_names" varchar, "pop" integer NOT NULL, "area" integer NOT NULL, "continent_id" integer, "country_id" integer, "s" boolean DEFAULT 'f' NOT NULL, "c" boolean DEFAULT 'f' NOT NULL, "d" boolean DEFAULT 'f' NOT NULL, "m" boolean DEFAULT 'f' NOT NULL, "motor" varchar, "alpha2" varchar, "alpha3" varchar, "num" varchar, "fifa" varchar, "ioc" varchar, "fips" varchar, "net" varchar, "wikipedia" varchar, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "states" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar NOT NULL, "key" varchar NOT NULL, "place_id" integer NOT NULL, "code" varchar, "abbr" varchar, "iso" varchar, "nuts" varchar, "alt_names" varchar, "country_id" integer NOT NULL, "level" integer DEFAULT 1 NOT NULL, "pop" integer, "area" integer, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "parts" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar NOT NULL, "key" varchar NOT NULL, "place_id" integer NOT NULL, "code" varchar, "abbr" varchar, "iso" varchar, "nuts" varchar, "alt_names" varchar, "state_id" integer NOT NULL, "level" integer DEFAULT 2 NOT NULL, "pop" integer, "area" integer, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "counties" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar NOT NULL, "key" varchar NOT NULL, "place_id" integer NOT NULL, "code" varchar, "abbr" varchar, "iso" varchar, "nuts" varchar, "alt_names" varchar, "state_id" integer NOT NULL, "part_id" integer, "level" integer DEFAULT 2 NOT NULL, "pop" integer, "area" integer, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "munis" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar NOT NULL, "key" varchar NOT NULL, "place_id" integer NOT NULL, "code" varchar, "abbr" varchar, "iso" varchar, "nuts" varchar, "alt_names" varchar, "state_id" integer NOT NULL, "county_id" integer, "level" integer DEFAULT 3 NOT NULL, "pop" integer, "area" integer, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "zones" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL);
CREATE TABLE "cities" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar NOT NULL, "key" varchar NOT NULL, "place_id" integer NOT NULL, "code" varchar, "alt_names" varchar, "country_id" integer NOT NULL, "state_id" integer, "part_id" integer, "county_id" integer, "muni_id" integer, "metro_id" integer, "pop" integer, "area" integer, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "metros" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar NOT NULL, "key" varchar NOT NULL, "place_id" integer NOT NULL, "code" varchar, "alt_names" varchar, "country_id" integer NOT NULL, "pop" integer, "area" integer, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "districts" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "name" varchar NOT NULL, "key" varchar NOT NULL, "place_id" integer NOT NULL, "code" varchar, "alt_names" varchar, "city_id" integer NOT NULL, "pop" integer, "area" integer, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "langs" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "key" varchar NOT NULL, "name" varchar NOT NULL, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "usages" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "country_id" integer NOT NULL, "lang_id" integer NOT NULL, "official" boolean DEFAULT 't' NOT NULL, "minor" boolean DEFAULT 'f' NOT NULL, "percent" float, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "persons" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "key" varchar NOT NULL, "name" varchar NOT NULL, "synonyms" varchar, "code" varchar, "born_at" date, "city_id" integer, "state_id" integer, "country_id" integer, "nationality_id" integer, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "teams" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "key" varchar NOT NULL, "title" varchar NOT NULL, "title2" varchar, "code" varchar, "synonyms" varchar, "country_id" integer NOT NULL, "city_id" integer, "club" boolean DEFAULT 'f' NOT NULL, "since" integer, "address" varchar, "web" varchar, "assoc_id" integer, "national" boolean DEFAULT 'f' NOT NULL, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "grounds" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "key" varchar NOT NULL, "title" varchar NOT NULL, "synonyms" varchar, "country_id" integer NOT NULL, "city_id" integer, "since" integer, "capacity" integer, "address" varchar, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "goals" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "person_id" integer NOT NULL, "game_id" integer NOT NULL, "team_id" integer NOT NULL, "minute" integer, "offset" integer DEFAULT 0 NOT NULL, "score1" integer, "score2" integer, "penalty" boolean DEFAULT 'f' NOT NULL, "owngoal" boolean DEFAULT 'f' NOT NULL, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "rosters" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "person_id" integer NOT NULL, "team_id" integer NOT NULL, "event_id" integer, "pos" integer NOT NULL, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "events" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "key" varchar NOT NULL, "league_id" integer NOT NULL, "season_id" integer NOT NULL, "start_at" date NOT NULL, "end_at" date, "team3" boolean DEFAULT 't' NOT NULL, "sources" varchar, "config" varchar, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "rounds" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "event_id" integer NOT NULL, "title" varchar NOT NULL, "title2" varchar, "pos" integer NOT NULL, "knockout" boolean DEFAULT 'f' NOT NULL, "start_at" date NOT NULL, "end_at" date, "auto" boolean DEFAULT 't' NOT NULL, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "groups" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "event_id" integer NOT NULL, "title" varchar NOT NULL, "pos" integer NOT NULL, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "games" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "key" varchar, "round_id" integer NOT NULL, "pos" integer NOT NULL, "group_id" integer, "team1_id" integer NOT NULL, "team2_id" integer NOT NULL, "play_at" datetime NOT NULL, "postponed" boolean DEFAULT 'f' NOT NULL, "play_at_v2" datetime, "play_at_v3" datetime, "ground_id" integer, "city_id" integer, "knockout" boolean DEFAULT 'f' NOT NULL, "home" boolean DEFAULT 't' NOT NULL, "score1" integer, "score2" integer, "score1et" integer, "score2et" integer, "score1p" integer, "score2p" integer, "score1i" integer, "score2i" integer, "score1ii" integer, "score2ii" integer, "next_game_id" integer, "prev_game_id" integer, "winner" integer, "winner90" integer, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "events_teams" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "event_id" integer NOT NULL, "team_id" integer NOT NULL, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "events_grounds" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "event_id" integer NOT NULL, "ground_id" integer NOT NULL, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "groups_teams" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "group_id" integer NOT NULL, "team_id" integer NOT NULL, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "seasons" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "key" varchar NOT NULL, "title" varchar NOT NULL, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "leagues" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "key" varchar NOT NULL, "title" varchar NOT NULL, "country_id" integer, "club" boolean DEFAULT 'f' NOT NULL, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "badges" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "team_id" integer NOT NULL, "league_id" integer NOT NULL, "season_id" integer NOT NULL, "title" varchar NOT NULL, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "assocs" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "key" varchar NOT NULL, "title" varchar NOT NULL, "since" integer, "web" varchar, "country_id" integer, "national" boolean DEFAULT 'f' NOT NULL, "continental" boolean DEFAULT 'f' NOT NULL, "intercontinental" boolean DEFAULT 'f' NOT NULL, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "assocs_assocs" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "assoc1_id" integer NOT NULL, "assoc2_id" integer NOT NULL, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "group_standings" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "group_id" integer NOT NULL, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "group_standing_entries" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "group_standing_id" integer NOT NULL, "team_id" integer NOT NULL, "pos" integer, "played" integer, "won" integer, "lost" integer, "drawn" integer, "goals_for" integer, "goals_against" integer, "pts" integer, "comments" varchar, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "event_standings" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "event_id" integer NOT NULL, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "event_standing_entries" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "event_standing_id" integer NOT NULL, "team_id" integer NOT NULL, "pos" integer, "played" integer, "won" integer, "lost" integer, "drawn" integer, "goals_for" integer, "goals_against" integer, "pts" integer, "comments" varchar, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "alltime_standings" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "key" varchar NOT NULL, "title" varchar NOT NULL, "created_at" datetime, "updated_at" datetime);
CREATE TABLE "alltime_standing_entries" ("id" INTEGER PRIMARY KEY AUTOINCREMENT NOT NULL, "alltime_standing_id" integer NOT NULL, "team_id" integer NOT NULL, "pos" integer, "played" integer, "won" integer, "lost" integer, "drawn" integer, "goals_for" integer, "goals_against" integer, "pts" integer, "recs" integer, "comments" varchar, "created_at" datetime, "updated_at" datetime);
